import { useState, useEffect, useRef } from 'react';
import './App.css'; // Stelle sicher, dass du Tailwind CSS importiert hast
import { BrowserRouter as Router, Route, Routes, useLocation } from 'react-router-dom';
import { CSSTransition, TransitionGroup } from 'react-transition-group';
import Header from './components/Header';
import Imprint from './components/Imprint';
import Navigation from './components/Navigation';
import Footer from './components/Footer';
import Service from './components/Service';
import Profile from './components/Profile';
import Work from './components/Work';
import Process from './components/Process';
import PersonaKit from './work/PersonaKit';
import DentaltechnikWeber from './work/DentaltechnikWeber';
import ShapeUp from './work/ShapeUp';
import Lottie from 'lottie-react';
import logoAnimation from './lottie/logoAnimation.json';

function App() {
  const location = useLocation();
  const [firstLoad, setFirstLoad] = useState(true);
  const cursorRef = useRef(null);
  const cursorFollowerRef = useRef(null);

  useEffect(() => {
    window.scrollTo(0, 0);
  }, [location]);

  useEffect(() => {
    const timer = setTimeout(() => {
      setFirstLoad(false);
    }, 1000);
    return () => clearTimeout(timer);
  }, []);

  useEffect(() => {
    const handleMouseMove = (e) => {
      if (cursorRef.current) {
        cursorRef.current.style.transform = `translate(${e.clientX}px, ${e.clientY}px)`;
      }
      if (cursorFollowerRef.current) {
        cursorFollowerRef.current.style.transform = `translate(${e.clientX}px, ${e.clientY}px)`;
      }
    };

    document.addEventListener('mousemove', handleMouseMove);

    return () => {
      document.removeEventListener('mousemove', handleMouseMove);
    };
  }, []);

  return (
    <div className="App flex flex-col items-center w-full">
      <Navigation />
      <TransitionGroup className="w-full">
        <CSSTransition
          key={location.key}
          timeout={1100}
          classNames="black-screen"
        >
          {state => (
            <div className="relative w-full h-full">
              <Routes location={location} className="w-full">
                <Route path="/" element={
                  <>
                    <Header />
                    <Work />
                    <Process />
                    <Profile />
                    <Service />
                    <section className='w-full bg-white'>
                      <Footer />
                    </section>
                  </>
                } />
                <Route path="/imprint" element={
                  <>
                    <Imprint />
                    <section className='w-full bg-white'>
                      <Footer />
                    </section>
                  </>
                } />
                <Route path="/personakit" element={
                  <>
                    <PersonaKit />
                    <section className='w-full bg-white'>
                      <Footer />
                    </section>
                  </>
                } />
                <Route path="/dentaltechnik-weber" element={
                  <>
                    <DentaltechnikWeber />
                    <section className='w-full bg-white'>
                      <Footer />
                    </section>
                  </>
                } />
                <Route path="/shape-up" element={
                  <>
                    <ShapeUp />
                    <section className='w-full bg-white'>
                      <Footer />
                    </section>
                  </>
                } />
              </Routes>
              {(firstLoad || state === 'entering' || state === 'exiting') && (
                <div className="fixed inset-0 bg-black flex items-center justify-center z-50">
                  <Lottie animationData={logoAnimation} style={{ height: '200px', width: '200px' }} />
                </div>
              )}
              <div
                ref={cursorRef}
                className="fixed rounded-full bg-white w-4 h-4 z-50 pointer-events-none"
                style={{ transform: 'translate(-50%, -50%)' }}
              />
              <div
                ref={cursorFollowerRef}
                className="fixed rounded-full bg-white w-4 h-4 z-40 pointer-events-none transition-transform duration-300 ease-in-out"
                style={{ transform: 'translate(-50%, -50%)' }}
              />
            </div>
          )}
        </CSSTransition>
      </TransitionGroup>
    </div>
  );
}

export default function Root() {
  return (
    <Router>
      <App />
    </Router>
  );
}
